[{"location":"#Hexdump.jl","page":"Hexdump.jl","title":"Hexdump.jl","text":"","category":"section"},{"location":"","page":"Hexdump.jl","title":"Hexdump.jl","text":"Documentation for Hexdump.jl","category":"page"},{"location":"","page":"Hexdump.jl","title":"Hexdump.jl","text":"hexdump","category":"page"},{"location":"#Hexdump.hexdump","page":"Hexdump.jl","title":"Hexdump.hexdump","text":"hexdump([output = stdout,] input, offset = 0, line_count = :all)\n\n    output      ::Union{IO, AbstractString}\n    intput      ::Union{IO, AbstractString}\n    offset      ::Int\n    line_count  ::Union{Symbol, Int}\n\nThe hexdump functions reads the raw bytes of input and prints the hexdump output to output, which defaults to stdout.  input can be a subtype of IO or point to a file, which will be used as the source.  output may also be a subtype of IO or point to a file, if the file is not present it will be created.  \n\nWhen reading the function will skip offset bytes, before actualy printing to output.   If line_count is set to :all the hexdump function will not stop until eof is reached, when setting line_count to an integer, the function will also stop after line_count lines have been printed.\n\n\n\n\n\n","category":"function"}]
